import React from 'react';

export default class Bookings extends React.Component {


	render(){
		return (
			<div className="App">
				<div className="card-text-centre" >
          <div className="card-body">
            <h5 className="card-title">Title: {this.props.title} </h5>
          </div>
          <div className="card-body">
            <h5 className="card-title">Director: {this.props.director} </h5>
          </div>
          <div className="card-body">
            <h5 className="card-title">Released Year: {this.props.year} </h5>
          </div>
          <div className="card-body">
            <h5 className="card-title">Duration: {this.props.duration} </h5>
          </div>
        </div>
      		</div>
     	);
 	}

}
